script: |
  super -f text -I q286.spq | sort > q286.out

inputs:
  - name: q286.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE - col1 / - col2 * + col2 NOT BETWEEN 9 * 51 AND + 38 / + 69 - - 60 + + col1;
  - name: tab1

outputs:
  - name: q286.out
    data: |
      51	14	96
      85	5	59
      91	47	68
